import React from "react";

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faBars, faBullseye } from '@fortawesome/free-solid-svg-icons'

const Navbar = () => {
    return (
        <div className="sideNavBar">
        <div className="sideNavHeader">
          <FontAwesomeIcon icon={faBars}/>
          <h2>SimpleSport</h2>
        </div>
        <div className="sideNavBody">
            <div className="sideNavItem"><FontAwesomeIcon icon={faBullseye}/>Schedule</div>
            <div className="sideNavItem"><FontAwesomeIcon icon={faBullseye}/>Roster</div>
            <div className="sideNavItem"><FontAwesomeIcon icon={faBullseye}/>Messenger</div>
        </div>
      </div>
    );
}

export default Navbar;
